import React from "react";
import RegisterForm from "../components/RegisterForm";

export default function RegisterPage() {
  return (
    <div style={{ maxWidth: "400px", margin: "20px auto" }}>
      <h2>Registro</h2>
      <RegisterForm />
    </div>
  );
}
